      headers: new Headers({
        "Access-Control-Allow-Origin": "*"
      })
    }).then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>

    </div>
  )
}

export default App
